    return(
        <div className = 'a-box'>
            <div class = 'a-b-img'>
                <img src ={props.image} alt=''/>
            </div>
            <div className = 'a-b-text'>
                <h2>{props.title}</h2>
                <p>Exercise using weights to increase muscle strength, and  bodybuilding.</p>
           </div>
        </div>
    )
}
export default Featurebox;
